        let map;
        let markerCluster;
        let markers = [];

        function initMap() {
            map = new google.maps.Map(document.getElementById('map'), {
                zoom: 7,
                center: { lat: 36.3, lng: 127.8 },
                mapTypeControl: false
            });

            markerCluster = new markerClusterer.MarkerClusterer({ map, markers: [] });
            updateMap();
        }

        function updateMap() {
            // Clear existing markers
            markers.forEach(m => m.setMap(null));
            markers = [];
            markerCluster.clearMarkers();

            const selectedMethods = Array.from(document.querySelectorAll('.method-filter:checked')).map(el => el.value);
            const startEp = parseInt(document.getElementById('start-ep').value) || 0;
            const endEp = parseInt(document.getElementById('end-ep').value) || 9999;

            const filteredData = rawData.filter(d => {
                return selectedMethods.includes(d.m) && d.e >= startEp && d.e <= endEp;
            });

            document.getElementById('count').innerText = filteredData.length.toLocaleString();

            const infoWindow = new google.maps.InfoWindow();

            filteredData.forEach(d => {
                let color = "blue";
                if(d.m === "수동") color = "red";
                if(d.m === "반자동") color = "green";

                const marker = new google.maps.Marker({
                    position: { lat: d.lt, lng: d.lg },
                    icon: {
                        path: google.maps.SymbolPath.CIRCLE,
                        fillColor: color,
                        fillOpacity: 0.7,
                        strokeColor: "white",
                        strokeWeight: 1,
                        scale: 7
                    },
                    title: d.n
                });

                marker.addListener("click", () => {
                    infoWindow.setContent(`
                        <div style="padding:10px; line-height:1.6;">
                            <strong style="font-size:14px; color:#1a237e;">${d.n}</strong><br>
                            <b>회차:</b> ${d.e}회 (${d.r})<br>
                            <b>방식:</b> ${d.m}<br>
                            <b>주소:</b> ${d.a}
                        </div>
                    `);
                    infoWindow.open(map, marker);
                });

                markers.push(marker);
            });

            markerCluster.addMarkers(markers);
        }

        google.maps.event.addDomListener(window, 'load', initMap);
        
        // Add event listeners for checkboxes
        document.querySelectorAll('.method-filter').forEach(el => {
            el.addEventListener('change', updateMap);
        });
    </script>
